description:
Vegetable and/or microbial oil, refined, containing by weight;
- 25% or more but not more than 70% arachidonic acid, or
- 12% or more but not more than 65% docosahexaenoic acid, and
Whether or not:

- standardized with high oleic sunflower oil (HOSO),
- containing by weight 0,005% or more, but not more than 0,1% of antioxidants &nbsp;

Cranberry juice concentrate:

- of a Brix value of 40 or more but not more than 66,

- in immediate packings of a content of 50 litres or more &nbsp;

Frozen acerola juice concentrate :

- with a Brix value of more than 48 but not more than 67,

- in immediate packings of a content of 50 litres or more &nbsp;

Casein protein hydrolysate consisting of:

- by weight 20 % or more but not more than 70 % free amino acids, and

- peptones of which by weight more than 90 % having a molecular weight of not more than 2000 Da &nbsp;

Sintered corundum with a micro crystalline structure, consisting of aluminium oxide (CAS RN 1344-28-1) and magnesium aluminate (CAS RN 12068-51-8), with a content by weight (calculated as oxides) of:

-92 % or more, but not more than 94 % of aluminium oxide, and

-7 % (± 1 %) of magnesium oxide &nbsp;

Titanium dioxide (CAS RN 13463-67-7):

- of a purity by weight of 99,9 % or more,

- with an average grain-size of 0,7 μm or more but not more than 2,1 μm &nbsp;

Calcium hydroxide of a purity of 98 % or more calculated on the dry weight, in the form of particles of which:
- not more than 1 % by weight have a particle-size exceeding 75 micrometres and
- not more than 4 % by weight have a particle-size of less than 1,3 micrometres &nbsp;

Disodium tungstate (CAS RN 13472-45-2) with a:

-purity by weight of 99 % or more,

-chlorine content of less than 100 ppm &nbsp;
